I am using a `$resource` to access a [CouchDB](http://couchdb.apache.org/) database (`app_db`).

    var Typename = $resource('/app_db/:base:id', { base: 'typename_' }, {
        query: { method: 'GET', isArray: false,
                 params: { base: '_all_docs', id: '', include_docs: 'true',
                           startkey: '"typename_"', endkey: '"typename_\uFFF0"' }
               }
    });

I need to override the default `Typename.query()` function because CouchDB always returns a JSON object and never an array. I also need to override the base URL, but the resource default takes precedence over the action default. So `Typename.query()` uses `'typename_'` instead of `'_all_docs'`.

The proposed patch, fixes this.
